import React from 'react';
import { useNavigate } from 'react-router-dom';
import './navbar.css';

const Navbar = () => {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };

  const handleCartClick = () => {
    // Handle cart button click
    console.log('Cart button clicked');
  };

  return (
    <nav className="navbar">
      <div className='center-nav'>
        <ul>
          <li onClick={() => handleNavigation('/men')}>Men</li>
          <li onClick={() => handleNavigation('/women')}>Women</li>
          <li onClick={() => handleNavigation('/kids')}>Kids</li>
        </ul>
      </div>
      <div className="logo-container" onClick={handleCartClick}>
        <img src="cart-logo.png" alt="Cart" className="cart-logo" />
      </div>
      <div className="search-container">
        <input type="text" placeholder="Search" />
        <button type="submit">Search</button>
      </div>
    </nav>
  );
}

export default Navbar;
